      __webpack_exports__["default"] = "<sbpro-layout-landing footerClasses=\"bg-dark footer-dark\"\n>\n    <sb-top-nav brandClasses=\"text-dark\" buttonClasses=\"btn-teal\" topNavClasses=\"bg-white navbar-light\"></sb-top-nav\n    >\n    <sbpro-page-section borderClasses=\"text-dark\" borderType=\"rounded\" sectionClasses=\"py-10 bg-light\"\n    >\n        <div class=\"container px-5\">\n            <h1 class=\"mb-4\">Le titan des frameworks front</h1>\n            <p>Angular, est un framework Javascript permettant de réaliser la partie front-end des applications web.\n                Encore\n                presque inconnu au bataillon quelques années avant, on entend de plus en plus parler de lui.</p>\n            <p>A ses côtés, on peut trouver les fameux React et VueJs, les papas des frameworks Javascript. Avec un\n                début compliqué,\n                n'étant suivi par aucune grosse société contrairement aux deux autres, Angular a su tirer son épingle du\n                jeu en proposant un développement\n                élégant et en livrant une courbe d'apprentissage assez aisée.</p>\n\n            <br/>\n            <h1 class=\"mb-4\"> Mon expérience personnelle </h1>\n            <p>J'ai découvert ce framework en 2017, lors d'un stage dans une startup. Nous avions pour but de créer un\n                projet en 6 mois avec mes collègues. un besoin d'apprendre rapidement, j'ai été conseillé sur ce\n                framework, afin d'être rapidement productif.</p>\n            <p>Nous avons donc développé l'application Taama (Une application de gestion des billets, caisse des agences\n                de voyages), à l'aide d'Angular en front et Django(python) pour le\n                backend. Le principe était de fournir une application web permettant de faciliter gestion de la\n                billetterie, caisse, gestion des clients et représentants, clients et reporting. afin d'avoir\n                une plateforme unifiée pour la vente des billets dans les agences de voyage.</p>\n            <br/>\n            <h1 class=\"mb-4\">\n                Une longue histoire d'amour\n            </h1>\n            <p>Au cours de mes expériences professionnelles, j'ai eu l'occasion et la chance de travailler avec\n                ce framework, en plus de mes projets personnels afin de me\n                perfectionner sur ce magnifique framework qu'est Angular\n            </p>\n\n            <hr class=\"my-5\"/>\n            <h4 class=\"mb-4\">\n                <div class=\"icon-stack bg-primary text-white me-2\">\n                    <i-feather name=\"arrow-right\"></i-feather>\n                </div>\n                Cas d'utilisation : <a routerLink=\"/landings/menu-cinema\"> Menu Cinéma </a> | <a\n                routerLink=\"/landings/edifier\">Worksite Manager</a>\n            </h4>\n\n        </div>\n    </sbpro-page-section>\n</sbpro-layout-landing>\n";
