      __webpack_require__.r(__webpack_exports__);
      /* harmony default export */


      __webpack_exports__["default"] = "<sbpro-layout-landing footerClasses=\"bg-dark footer-dark\"\n>\n    <sb-top-nav brandClasses=\"text-dark\" buttonClasses=\"btn-teal\" topNavClasses=\"bg-white navbar-light\"></sb-top-nav\n    >\n    <sbpro-page-section borderClasses=\"text-dark\" borderType=\"rounded\" sectionClasses=\"py-10 bg-light\"\n    >\n        <div class=\"container px-5\">\n            <p>Lors de ma formation et de mon alternance, j’ai travaillé sur plusieurs projet qui m’ont aidé a être de\n                plus en plus autonome dans mon travail.</p>\n            <p>Il faut dire que l’autonomie est une qualité très demandée par les entreprises. Cependant être autonome\n                n’est pas inné, c’est une compétence qu’il faut travailler.</p>\n            <p>La notion d’autonomie se rapproche beaucoup de celle de responsabilité et n’est pas la même chose que\n                d’être livré à soi-même. C’est savoir prendre des initiatives, des décisions, savoir régler les aléas et\n                les problèmes lors d’un projet.</p>\n            <p>Être autonome, c’est aussi savoir se gérer. L’un des points les plus importants est d’apprendre à manager\n                son temps. Il faut savoir différencier les tâches importantes et urgentes face aux tâches annexes.</p>\n            <p>L’avenir d’une entreprise passe nécessairement par la reconnaissance d’une réelle autonomie au travail\n                qui repose sur la confiance, la bienveillance et une vraie délégation de pouvoir. Les collaborateurs\n                doivent pouvoir disposer de réelles possibilités d’organiser leur travail, de prendre des initiatives,\n                d’être force de proposition et d’être écoutés.</p>\n            <p>Au début de ma mission indépendante avec un collègue étudiant en 2019.Nous avons entrepris le projet\n                intitulé <a routerLink=\"/landings/edifier\">Worksite-manager</a>.La particularité de ceci est que nous\n                étions 2 développeurs sur le projet, et ces 2 développeurs n'étaient que mon camarade et moi.Sans\n                accompagnement\n                nous avons rédigé des spécifications fonctionnelles, et l'ensemble de la partie technique relevait de\n                notre responsabilité.</p>\n            <p>Ce fut une première expérience très intéressante car nous devions faire preuve d’une véritable autonomie.\n                Toute l’architecture technique et les développements étaient entre nos mains.</p>\n\n        </div>\n    </sbpro-page-section\n    >\n</sbpro-layout-landing\n>\n";
