      __webpack_exports__["default"] = "<sbpro-layout-landing footerClasses=\"bg-dark footer-dark\"\n>\n    <sb-top-nav brandClasses=\"text-dark\" buttonClasses=\"btn-teal\" topNavClasses=\"bg-white navbar-light\"></sb-top-nav\n    >\n    <sbpro-page-section borderClasses=\"text-dark\" borderType=\"rounded\" sectionClasses=\"py-10 bg-light\"\n    >\n        <div class=\"container px-5\">\n            <h1 class=\"mb-4\">Commencer par le fond</h1>\n            <p>Lorsqu'on cherche à se former en autodidacte au développement, on est très souvent redirigé vers des\n                tutoriels de HTML et de CSS. Ce fut mon cas, ma première expérience s'était faite à partir d'un tutoriel\n                de l'ancien Site du Zero, qui m'avait appris à créer un\n                site statique mettant en exergue les bases du HTML et du CSS</p>\n            <p>Le HTML, c'est un langage de balisage, qui va service à créer la structure d'une page web. On va y\n                trouver tout le texte des sites, l'arrangement des éléments, les titres, les paragraphes, les listes\n                pucées et j'en passe. De son côté, le CSS est un langage permettant\n                de mettre en forme le dit HTML. On va y rajouter tout notre style, l'habillage de celui-ci : le\n                placement, les couleurs, et même quelques animations.</p>\n            <p class=\"mb-0\">Bien que ces deux-ci soient complétement différents, ils ne marchent pas l'un sans l'autre,\n                c'est d'ailleurs pourquoi je les ai regroupé en une seule section.</p>\n            <hr class=\"my-5\"/>\n            <h4 class=\"mb-4\">\n                <div class=\"icon-stack bg-primary text-white me-2\">\n                    <i-feather name=\"arrow-right\"></i-feather>\n                </div>\n                Complet et inévitable\n            </h4>\n            <p>Aujourd'hui, les HTML et le CSS empatissent d'une mauvaise réputation, on ommet souvent ces compétences\n                car elles n'intègrent pas les notions d'algorythmie du développement.</p>\n            <p>Toutefois, il est possible de réaliser des choses époustouflantes avec ces deux langages qui semblent\n                très simple à appréhender. Dans chaque application web, ils sont présents. </p>\n            <p>Les applications web plus complexes vont demander des besoins de plus en plus en adéquation avec les\n                technologies actuelles, les smartphones ont apporté notamment la notion de responsive.\n                On attend donc d'une bonne application web qu'elle s'adapte aux différentes tailles de device, et cette\n                pratique ne peut être réalisée qu'avec du CSS, et on saura facilement différencier une application avec\n                un bonne maîtrise de ces technologies dans la valise.</p>\n            <p>Personnellement, j'accorde beaucoup d'importances à tout ce qui est de l'expérience utilisateur, et\n                l'interface utilisateur. Je mets donc en pratique mes compétences pour créer des applications\n                ergonomiques et agréables à l'oeil. Vous pourrez notamment retrouver certaines de mes créations sur mon\n                profil Codepen.\n            </p>\n            <p>Je l'utilise pour pratiquement tous les projets professionnels et personnels. Ce portfolio illustre\n                parfaitement l'utilisation de cette compétence.\n                J'ai dû m'en servir aussi sur <a routerLink=\"/landings/menu-cinema\"> Menu Cinéma </a> | <a\n                    routerLink=\"/landings/edifier\">Worksite Manager</a>\n\n        </div>\n    </sbpro-page-section\n    >\n</sbpro-layout-landing\n>\n";
