      __webpack_exports__["default"] = "<sbpro-layout-landing footerClasses=\"bg-dark footer-dark\"\n>\n    <sb-top-nav brandClasses=\"text-dark\" buttonClasses=\"btn-teal\" topNavClasses=\"bg-white navbar-light\"></sb-top-nav\n    >\n    <sbpro-page-section borderClasses=\"text-dark\" borderType=\"rounded\" sectionClasses=\"py-10 bg-light\"\n    >\n        <div class=\"container px-5\">\n            <h1 class=\"mb-4\">Un langage incontournable</h1>\n            <p>JavaScript est un langage de programmation de scripts principalement employé dans les pages web\n                interactives mais aussi pour les serveurs avec l'utilisation (par exemple) de Node.js.</p>\n            <p>Dans chaque site web, on retrouve le Javascript. Il sert à rendre des pages web interractives et aussi\n                dynamiques. Dès que vous vous retrouvez avec des données, il y a du Javascript, c'est ce qui en fait une\n                technologie des plus utilisées chez les développeurs.</p>\n            <p class=\"mb-0\">Outre que d'être utilisé dans les sites webs, il peut aussi être utilisé comme langage pour\n                les serveurs avec Node.js, et peut même être utilisé à travers divers frameworks comme React-Native pour\n                la création d'applications mobiles, ce qui en fait, une\n                technologie inévitable autant pour sa versatilité, que pour son côté indispensable pour les applications\n                web.\n            </p><br>\n            <p class=\"mb-0\">\n                J’ai fais mes premiers pas en JavaScript lors de mon semestre 1. Nous évoluions sur du Node.Js\n                et cela m’a permis de créer mon premier site web dynamique. Il s’agissait d’un jeu de questions de\n                culture générale.\n                C’est notamment grâce à ce projet que j’ai voulu continuer à monter en compétence sur du JavaScript.\n            </p>\n            <hr class=\"my-5\"/>\n            <h4 class=\"mb-4\">\n                <div class=\"icon-stack bg-primary text-white me-2\">\n                    <i-feather name=\"arrow-right\"></i-feather>\n                </div>\n                Avec enormément d'outils\n            </h4>\n            <p>Javascript tire sa force de sa communauté. Elle recence énormément de développeurs qui contribuent chaque\n                jour à la création de nouveaux outils pour les autres développeurs. On va y retrouver par odre\n                d'importance :</p>\n            <div class=\"card bg-light shadow-none\">\n                <div class=\"card-body\">\n                    <ul class=\"mb-0\">\n                        <li class=\"font-italic\">Les frameworks, principalemment React, Vuejs et Angular. Ils permettent\n                            la création de code front-end (s'éxécutant dans un navigateur) de façon très guidée en\n                            incorporant des fonctionnalités essentielles.\n                        </li>\n                        <li class=\"font-italic\">Les libraires, pour n'en citer qu'une : Jquery, qui va par exemple\n                            servir à manipuler les éléments du dom beaucoup plus facilement qu'en utilisant du\n                            Javascript dit \"pure\".\n                        </li>\n                        <li class=\"font-italic\">Les modules, qui vont servir à fournir des petits composants de code\n                            pour se faciliter la vie : par exemple, moment.js pour gérer les dates et les heures sans se\n                            soucier de tous les problemes qui en découlent.\n                        </li>\n                    </ul>\n                </div>\n            </div>\n            <hr class=\"my-5\"/>\n            <h4 class=\"mb-4\">\n                <div class=\"icon-stack bg-primary text-white me-2\">\n                    <i-feather name=\"arrow-right\"></i-feather>\n                </div>\n                Cas d'utilisation : <a routerLink=\"/landings/menu-cinema\"> Menu Cinéma </a>\n            </h4>\n        </div>\n    </sbpro-page-section\n    >\n</sbpro-layout-landing\n>\n";
